import React from 'react';
import Peopleinfo from './Peopleinfo';


const List = () => {
    const people = this.people;
    return (
        <div>
            {people.map((i) => {
                return (<Peopleinfo key={i} name={people[i].name}
                    birth_year={people[i].birth_year}
                    height={people[i].height}
                    mass={people[i].mass}/>)
            })
            }
        </div>
    );
}

export default List;
